import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './Components/Header'
import TaskBar from './Components/TaskBar'
import TaskList from './Components/TaskList'



function App() {
  return (
    <div>
      <Header />
      <TaskBar />
      <TaskList />
    </div>
  );
}

export default App;
